(2, '2010-11-06', '0000-00-00 00:00:00', 0, '2010', '150', 25, 30, 'Juniper-Poplar Hall', 'Tampa', 'FL', '33620', 0, 0, '<p>\n	<strong>Included in Hatter Fee:</strong></p>\n<ul>\n	<li>\n		Registration starts at 8:00 am.</li>\n	<li>\n		Games start at 9:00 am.</li>\n	<li>\n		Everyone will be provided with a &quot;team&quot; shirt.</li>\n	<li>\n		Water will be provided at the fields.</li>\n	<li>\n		Pizza during Finals Game</li>\n	<li>\n		Breakfast will be provided- Fruit, bagels, etc</li>\n</ul>\n<p>\n	<strong>Location</strong>: Magonlia Fields</p>\n<p>\n	Directly across from the Juniper-Poplar Hall (on Map)</p>\n<p>\n	On the corner of Magonlia Drive and Alumni Drive</p>\n<p>\n	<strong>Parking</strong>:</p>\n<p>\n	Small parking Lot on Magonlia Drive, next to the fields</p>\n<p>\n	Parking Garage on corner of Walnut Drive and Alumni Drive on Levels 3-8</p>\n<p>\n	&nbsp;</p>\n<p>\n	NO ALCOHOL ALLOWED</p>\n<p>\n	NO DOGS ALLOWED!</p>\n<p>\n	No tent staking, no parking on fields.&nbsp;</p>\n'),
(3, '2011-11-12', '2011-11-01 00:00:00', 0, '2011', '150', 25, 30, 'Juniper-Poplar Hall', 'Tampa', 'FL', '33620', 0, 0, '<h3>\n	Included in Hatter Fee:</h3>\n<ul>\n	<li>\n		Registration starts at 8:00 am.</li>\n	<li>\n		Games start at 9:00 am.</li>\n	<li>\n		Everyone will be provided with a &quot;team&quot; shirt.</li>\n	<li>\n		Water will be provided at the fields.</li>\n	<li>\n		Pizza during Finals Game</li>\n	<li>\n		Breakfast will be provided- Fruit, bagels, etc</li>\n</ul>\n<h3>\n	Location:</h3>\n<ul>\n	<li>\n		Magonlia Fields</li>\n	<li>\n		Directly across from the Juniper-Poplar Hall (on Map)</li>\n	<li>\n		On the corner of Magonlia Drive and Alumni Drive</li>\n</ul>\n<h3>\n	Parking:</h3>\n<ul>\n	<li>\n		Small parking Lot on Magonlia Drive, next to the fields</li>\n	<li>\n		Parking Garage on corner of Walnut Drive and Alumni Drive on Levels 3-8</li>\n</ul>\n<h3>\n	Rules:</h3>\n<ul>\n	<li>\n		<strong>NO ALCOHOL ALLOWED</strong></li>\n	<li>\n		<strong>NO DOGS ALLOWED!</strong></li>\n	<li>\n		No tent staking, no parking on fields.&nbsp;</li>\n</ul>\n'),
(4, '2012-11-17', '2012-11-12 00:00:00', 0, '2012', '150', 25, 30, 'USF Magnolia Fields', 'Tampa', 'Fl', '33620', 0, 0, '<h3>\n	Requests:</h3>\n<ul>\n	<li>\n		You may request <em><strong>one </strong></em>another player.</li>\n	<li>\n		We <em><strong>try </strong></em>to honor all mutal requests.&nbsp;</li>\n</ul>\n<h3>\n	Included in Hatter Fee:</h3>\n<ul>\n	<li>\n		Registration starts at 8:00 am.</li>\n	<li>\n		Games start at 9:00 am.</li>\n	<li>\n		Everyone will be provided with a &quot;team&quot; shirt.</li>\n	<li>\n		Water will be provided at the fields.</li>\n	<li>\n		Breakfast will be provided- Fruit, bagels, etc</li>\n</ul>\n<h3>\n	Location:</h3>\n<ul>\n	<li>\n		Magonlia Fields</li>\n	<li>\n		Directly across from the Juniper-Poplar Hall (on Map)</li>\n	<li>\n		On the corner of Magonlia Drive and Alumni Drive</li>\n</ul>\n<h3>\n	Parking:</h3>\n<ul>\n	<li>\n		Small parking Lot on Magonlia Drive, next to the fields</li>\n	<li>\n		Parking Garage on corner of Walnut Drive and Alumni Drive on Levels 3-8</li>\n</ul>\n<h3>\n	Rules:</h3>\n<ul>\n	<li>\n		<strong>NO ALCOHOL ALLOWED</strong></li>\n	<li>\n		<strong>NO DOGS ALLOWED!</strong></li>\n	<li>\n		No tent staking, no parking on fields.</li>\n</ul>\n'),
(5, '2013-11-23', '2013-11-16 00:00:00', 1, '2013', '150', 30, 0, 'Magnolia Fields Complex, USF Alumni Drive', 'Tampa', 'FL', '33612', 0, 0, '<p>\n	EVERYONE MUST PAY ONLINE THIS YEAR!!!!!</p>\n<p>\n	You can sign-up whenever you would like but your spot will NOT be reserved until you pay via paypal!!!</p>\n');

